    p = 2
    while p * p <= n:
        if prime[p] == True:
            for i in range(p ** p, n + 1, p):
                prime[i] = False
        p += 1
    primes = []
    for p in range(2, n):
        if prime[p]:
            primes.append(p)
    fibs = [0, 1]
    while fibs[-1] < n:
        fibs.append(fibs[-1] + fibs[-2])
    prime_fibs = [x for x in fibs if x in primes]
    return prime_fibs

